    [],nt"revision_timestamp": "2016-07-27T22:20:19.410022",nt"name": "stillwater-national-wildlife-refuge-including-stillwater-wildlife-management-area-fallon-n-21a38",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Stillwater
    NWR and WMA, Fallon NWR, and Anaho Island NWR outlines Refuge accomplishments during
    the 1992 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses compliance with environmental and cultural resource mandates
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, croplands,
    grasslands, grazing, and water rights. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife propagation,
    scientific collections, animal control, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, wildlife observation, outdoor recreation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, and communication systems. Cooperative programs, economic uses of the
    Refuge, and items of interest are provided at the end.",nt"license_title":
